INSERT INTO `material` VALUES (1,'','','','','2009-09-28','About Us','','','<h3>Our <span class=\"bold\">company</span></h3>\r\n<p>FinFisher is a dynamic and client dedicated company that employs some of the best specialists world-wide in the field of research, development and offensive IT intrusion.</p>\r\n<p>While the Munich based developers constantly seek to use the latest technologies available for their products, the global sales team ensures that all innovations are driven by marked demand or in some cases specific customer requirements.</p>\r\n<div id=\"article\">\r\n<p><span class=\"bold\">FinFisher stands for</span></p>\r\n<div id=\"table\">\r\n<div id=\"column\">\r\n<ul>\r\n    <li>Top quality end-to-end solutions, developed for and introduced to clients by world-class specialists</li>\r\n    <li>Unique portfolio and expertise to build up effective cyber security departments</li>\r\n</ul>\r\n</div>\r\n<div id=\"column\">\r\n<ul>\r\n    <li>Trustworthy and reliable partners that treat their customers with the utmost confidentiality</li>\r\n    <li>More than ten years of experience in the field of innovative IT intrusion</li>\r\n</ul>\r\n<h3>Company <span class=\"bold\">profile</span></h3>\r\n<div id=\"column_wide\">\r\n<ul>\r\n    <li>Headquartered in Munich, Germany</li>\r\n    <li>Global Sales and Representative Offices</li>\r\n    <li>Over 40 employees</li>\r\n    <li>Established in 2007 as part of the Gamma Group</li>\r\n    <li>Independent organization and owned since 1st October 2013</li>\r\n    <li>Financially independent and privately owned</li>\r\n</ul>\r\n</div>\r\n</div>\r\n</div>\r\n</div>','2014-02-18 13:17:47','2009-09-28 00:00:00','en',1,1,0,0),(3,'','','','','2009-10-04','Sales & Marketing','','','<table width=\"100%\" cellspacing=\"1\" cellpadding=\"1\" border=\"0\">\r\n    <tbody>\r\n        <tr>\r\n            <td width=\"1\" valign=\"top\"><img width=\"115\" border=\"1\" align=\"top\" height=\"73\" src=\"/GGI/UserFiles/Image/Globe-with-Europe-&amp;-Asia-Region_27-03-09.png\" alt=\"Sales &amp; Marketing\" /></td>\r\n            <td valign=\"top\" style=\"padding-left: 8px;\">\r\n            <p>FinFisher GmbH<br /><br />Munich<br />Germany<br /><br />Tel. +49 89 785 76175<br /><br /><a href=\"mailto:so@finfisher.com\">dm@finfisher.com</a><br /><br /></p>\r\n            </td>\r\n        </tr>\r\n    </tbody>\r\n</table>','2014-02-18 13:17:34','2009-10-04 13:38:29','en',1,1,0,0),(2,'','','','','2009-10-04','Support','','','<table width=\"100%\" cellspacing=\"1\" cellpadding=\"1\" border=\"0\">\r\n    <tbody>\r\n        <tr>\r\n            <td width=\"1\" valign=\"top\"><img align=\"top\" width=\"115\" height=\"82\" border=\"1\" alt=\"Support\" src=\"/GGI/UserFiles/Image/4970628.jpg\" /></td>\r\n            <td valign=\"top\" style=\"padding-left: 8px;\">\r\n            <p>FinFisher GmbH<br /><br />Munich<br />Germany<br /><br />Tel. +49 89 78576175<br /><br /><a href=\"mailto:support@finfisher.com\">support@finfisher.com</a><br /><br /></p>\r\n            </td>\r\n        </tr>\r\n    </tbody>\r\n</table>','2014-01-18 20:40:13','2009-10-04 13:42:25','en',1,1,0,0);
