INSERT INTO `news` VALUES (29,'Link: The H-Security','Daily updated news-site that covers mostly all important security related news.\r\n','','2010-01-01','www.h-online.com/security/','_blank',2,1,0,'en',5,'2010-03-12 17:09:39','2010-05-25 14:58:11'),(30,'Link: Cheat-Sheets','Amazing collection of professional cheat-sheets for all many topics including network protocols and application syntaxes.\r\n','','2010-01-01','packetlife.net/library/cheat-sheets/','_blank',2,1,0,'en',5,'2010-03-12 17:11:47','2010-03-12 17:11:47'),(28,'Book: The Web Application Hacker\'s Handbook','This book is a practical guide to discovering and exploiting security flaws in web applications. The authors explain each category of vulnerability using real-world examples, screen shots and code extracts. The book is extremely practical in focus, and describes in detail the steps involved in detecting and exploiting each kind of security weakness found within a variety of applications such as online banking, e-commerce and other web applications.\r\n','News28.jpg','2010-03-12','www.amazon.com/Web-Application-Hackers-Handbook-Discovering/dp/0470170778/ref=sr_1_1?ie=UTF8&s=books&qid=1268332313&sr=8-1 --','_blank',2,1,0,'en',5,'2010-03-12 17:06:49','2010-03-12 17:07:45'),(27,'Book: The Art of Deception','Considering Mitnick\'s reputation as a hacker guru, it\'s ironic that the last point of attack for hackers using social engineering are computers. Most of the scenarios in The Art of Deception work just as well against computer-free organizations and were probably known to the Phoenicians; technology simply makes it all easier. Phones are faster than letters, after all, and having large organizations means dealing with lots of strangers.\r\n','News27.jpg','2010-03-12','www.amazon.com/Art-Deception-Controlling-Element-Security/dp/076454280X/ref=sr_1_3?ie=UTF8&s=books&qid=1268331543&sr=8-3','_blank',2,1,0,'en',5,'2010-03-12 17:04:35','2010-03-12 17:05:25'),(26,'Book: The Art of Intrusion','Infamous criminal hacker turned computer security consultant Mitnick offers an expert sequel to his best-selling The Art of Deception, this time supplying real-life rather than fictionalized stories of contemporary hackers sneaking into corporate servers worldwide.\r\n','News26.jpg','2010-03-10','www.amazon.com/Art-Intrusion-Exploits-Intruders-Deceivers/dp/0471782661/ref=sr_1_1?ie=UTF8&s=books&qid=1268331543&sr=8-1','_blank',2,1,0,'en',5,'2010-03-12 17:01:09','2010-03-12 17:02:27'),(56,'ISS World Europe','Prague, Czech Republic','News56.png','Jun. 5-7, 2012','www.issworldtraining.com/ISS_EUROPE/','_blank',1,1,1,'en',5,'2011-12-13 15:07:30','2011-12-13 14:09:55'),(25,'Book: Hacking: The Art of Exploitation','Hackers are always pushing the boundaries, investigating the unknown, and evolving their art. Even if you don\'t already know how to program, Hacking: The Art of Exploitation, 2nd Edition will give you a complete picture of programming, machine architecture, network communications, and existing hacking techniques. Combine this knowledge with the included Linux environment, and all you need is your own creativity.\r\n','News25.jpg','2010-02-28','www.amazon.com/Hacking-Art-Exploitation-Jon-Erickson/dp/1593271441/ref=sr_1_1?ie=UTF8&s=books&qid=1268331537&sr=8-1','_blank',2,1,0,'en',5,'2010-03-12 13:14:02','2010-03-12 13:18:33'),(24,'Book: Gray Hat Hacking','Find out how to execute effective penetration tests, use fuzzers and sniffers, perform reverse engineering, and find security holes in Windows and Linux applications. You\'ll also learn how to trap and autopsy stealth worms, viruses, rootkits, adware, and malware.\r\n\r\n','News24.jpg','2010-03-01','www.amazon.com/Gray-Hat-Hacking-Second-Handbook/dp/0071495681/ref=sr_1_1?ie=UTF8&s=books&qid=1268331511&sr=8-1','_blank',2,1,0,'en',5,'2010-03-12 13:05:34','2010-03-12 13:11:40'),(31,'Link: TinEye: Reverse Image Search Engine','TinEye is a reverse image search engine. You can submit an image to TinEye to find out where it came from, how it is being used, if modified versions of the image exist, or to find higher resolution versions.\r\n\r\n','','2010-01-01','www.tineye.com/','_blank',2,1,0,'en',5,'2010-03-12 17:13:24','2010-03-12 17:13:24'),(32,'Link: Read Notify','ReadNotify tells you when email you sent gets opened by a Target and displays you the Target\'s IP address, browser version and much more. It\'s a very powerful services for identifying Targets behind webmail accounts.\r\n','','2010-01-01','www.readnotify.com/','_blank',2,1,0,'en',5,'2010-03-12 17:15:31','2010-03-12 17:16:44'),(55,'ISS World Europe','Prague, Czech Republic','News55.png','Jun. 5-7, 2012','www.issworldtraining.com/ISS_EUROPE/','_blank',1,1,1,'en',5,'2011-12-13 15:04:37','2011-12-13 14:05:51'),(54,'HOSDB 2012','Farnborough, UK','News54.png','Jan. 31-Feb. 02, 2012','www.adsgroup.org.uk/pages/25413149.asp','_blank',1,1,1,'en',5,'2011-12-13 14:59:41','2011-12-13 14:05:57'),(53,'ISS World Europe','Prague, Czech Republic','News53.png','Jun. 5-7, 2012','www.issworldtraining.com/ISS_EUROPE/','_blank',1,1,1,'en',5,'2011-12-12 18:40:05','2011-12-13 14:00:51'),(36,'Book: SQL Injection Attacks and Defense','This title is the winner of the Best Book Bejtlich Read in 2009 award! \'SQL injection is probably the number one problem for any server-side application, and this book is unequaled in its coverage\' - Richard Bejtlich. SQL injection represents one of the most dangerous and well-known, yet misunderstood, security vulnerabilities on the internet, largely because there is no central repository of information to turn to for help. This is the only book devoted exclusively to this long-established but recently growing threat. It includes all the currently known information about these attacks and significant insight from its contributing team of SQL injection experts. What is SQL injection? Understand what it is and how it works. Find, confirm, and automate SQL injection discovery. Discover tips and tricks for finding SQL injection within the code. Create exploits using SQL injection. Design to avoid the dangers of these attacks.','News36.jpg','2010-05-18','www.amazon.de/Injection-Attacks-Defense-Justin-Clarke/dp/1597494240/ref=sr_1_1?ie=UTF8&s=books-intl-de&qid=1274184797&sr=8-1','_blank',2,1,0,'en',5,'2010-05-18 12:15:49','2010-05-18 12:28:01'),(37,'Book: Scene of the Cybercrime','When it comes to computer crimes, the criminals got a big head start. But the law enforcement and IT security communities are now working diligently to develop the knowledge, skills, and tools to successfully investigate and prosecute Cybercrime cases. When the first edition of \"Scene of the Cybercrime\" published in 2002, it was one of the first books that educated IT security professionals and law enforcement how to fight Cybercrime. Over the past 5 years a great deal has changed in how computer crimes are perpetrated and subsequently investigated. Also, the IT security and law enforcement communities have dramatically improved their ability to deal with Cybercrime, largely as a result of increased spending and training.','News37.jpg','2010-05-18','www.amazon.de/Scene-Cybercrime-Debra-Littlejohn-Shinder/dp/1597492760/ref=sr_1_1?ie=UTF8&s=books-intl-de&qid=1274185158&sr=1-1','_blank',2,1,0,'en',5,'2010-05-18 12:20:17','2010-05-25 14:56:41'),(38,'Book: CD and DVD Forensics','\"CD and DVD Forensics\" will take the reader through all facets of handling, examining, and processing CD and DVD evidence for computer forensics. At a time where data forensics is becoming a major part of law enforcement and prosecution in the public sector, and corporate and system security in the private sector, the interest in this subject has just begun to blossom. \"CD and DVD Forensics\" is a how to book that will give the reader tools to be able to open CDs and DVDs in an effort to identify evidence of a crime. These tools can be applied in both the public and private sectors. Armed with this information, law enforcement, corporate security, and private investigators will be able to be more effective in their evidence related tasks','News38.jpg','2010-05-18','www.amazon.de/CD-DVD-Forensics-Syngress-Media/dp/1597491284/ref=sr_1_1?ie=UTF8&s=books-intl-de&qid=1274185596&sr=1-1','_blank',2,1,0,'en',5,'2010-05-18 12:27:16','2010-05-18 12:29:00'),(48,'Cyber Warfare Europe','Berlin, Germany','News48.png','September 26-29, 2011','www.cyberwarfare-europe.com/Event.aspx?id=512314','_blank',1,1,1,'en',5,'2011-06-30 14:54:21','2011-09-30 08:36:57'),(40,'Milipol Paris','Paris, France','News40.png','October 18-21, 2011','en.milipol.com/','_blank',1,1,1,'en',5,'2011-01-03 11:31:52','2011-10-24 13:09:32'),(49,'ICPO 2011','Hanoi, Vietnam','News49.png','Oct. 31-Nov. 03, 2011','www.interpol.int/','_blank',1,1,1,'en',5,'2011-09-30 10:35:50','2011-12-12 17:37:08'),(50,'ISS Asia Pacific','Kuala Lumpur, Malaysia','News50.png','Dec. 6-8, 2011','www.issworldtraining.com/ISS_AP/','_blank',1,1,1,'en',5,'2011-10-24 15:10:56','2011-12-12 17:37:04'),(51,'ISS World Europe','Prague, Czech Republic','News51.png','Jun. 5-7, 2012','www.issworldtraining.com/ISS_EUROPE/','_blank',1,1,1,'en',5,'2011-10-24 15:12:12','2011-12-13 14:03:10'),(45,'ISS World Latin America','Brasilia, Brazil','News45.png','July 26-28, 2011','www.issworldtraining.com/ISS_BRASILIA/index.htm','_blank',1,1,1,'en',5,'2011-03-29 11:44:12','2011-06-30 12:52:58'),(52,'ISS World MEA','Dubai, UAE','News52.png','Feb. 13-15, 2012','www.issworldtraining.com/ISS_MEA/index.htm','_blank',1,1,1,'en',5,'2011-12-12 18:38:56','2011-12-13 14:06:03'),(47,'ISS World Americas','Washington DC, USA','News47.png','October 11-13, 2011','www.issworldtraining.com/ISS_WASH/','_blank',1,1,1,'en',5,'2011-03-29 11:49:24','2011-10-24 13:09:28'),(57,'ISS World MEA','Dubai, UAE','News57.png','Feb. 13-15, 2012','www.issworldtraining.com/ISS_MEA/index.htm','_blank',1,1,1,'en',5,'2011-12-13 15:09:11','2011-12-13 14:09:48'),(58,'ISS World Latin America','Brazilia, Brazil','News58.png','July 24-26, 2012','www.issworldtraining.com/ISS_BRASILIA/index1.htm','_blank',1,1,1,'en',5,'2011-12-13 15:11:04','2012-10-10 09:17:43'),(59,'ISS World MEA','Dubai, UAE','News59.png','March 4-6, 2013','www.issworldtraining.com/iss_mea/','_blank',1,1,1,'en',5,'2011-12-13 15:12:56','2013-07-08 09:45:41'),(60,'ISS World Asia Pacific','Kuala Lumpur, Malaysia','News60.png','December 11-13, 2012','www.issworldtraining.com/iss_ap/','_blank',1,1,1,'en',5,'2011-12-13 15:14:20','2013-07-08 09:45:38'),(61,'Home Office  (Security & Policing 2013)','Farnborough, UK ','News61.png','March 12-14, 2013','www.adsgroup.org.uk/articles/29679','_blank',1,1,1,'en',5,'2012-10-10 10:58:11','2013-07-08 09:45:34'),(62,'ISS World Americas','Washington, DC','News62.jpg','October 10-12, 2012','www.issworldtraining.com/ISS_WASH/index.htm','_blank',1,1,1,'en',5,'2012-10-10 11:17:11','2013-07-08 09:45:30'),(63,'ISS Latin America','Brasilia, Brazil','News63.png','July 23-25, 2013','www.issworldtraining.com/ISS_BRASILIA/index1.htm','_blank',1,1,1,'en',5,'2013-07-08 11:47:31','2014-02-17 14:57:12'),(64,'ISS World Americas','Washington, D.C.','News64.png','September 25-27, 2013','www.issworldtraining.com/ISS_WASH/index.htm','_blank',1,1,1,'en',5,'2013-07-08 11:49:03','2014-02-17 14:57:18'),(65,'Milipol Paris','Paris, France','News65.png','November 19-22, 2013','en.milipol.com/','_blank',1,1,1,'en',5,'2013-07-08 11:50:41','2014-02-17 14:57:27'),(66,'ISS World Middle East','Dubai, UAE','News66.png','March 3-5, 2014','www.issworldtraining.com/ISS_MEA/index.htm','_blank',1,1,1,'en',10,'2014-02-17 15:19:47','2014-03-10 09:43:37'),(67,'ISS World Europe','Prague, Czech Republic','News67.png','June 3-5, 2014','www.issworldtraining.com/ISS_EUROPE/','_blank',1,1,0,'en',10,'2014-02-17 15:26:11','2014-02-17 14:48:38'),(68,'ISS World South Africa','Johannesburg, ZA','News68.png','July 15-17, 2014','www.issworldtraining.com/ISS_SA/index.htm','_blank',1,1,0,'en',10,'2014-02-17 15:33:51','2014-02-18 08:36:32'),(69,'ISS World Americas','Washington D.C., USA','News69.png','October 6-8, 2014','www.issworldtraining.com/ISS_WASH/index.htm','_blank',1,1,0,'en',10,'2014-02-17 15:35:19','2014-02-17 14:48:01'),(70,'Milipol Qatar','Doha, Qatar','News70.png','November 10-12, 2014','www.milipolqatar.com/','_blank',1,1,1,'en',10,'2014-02-17 15:37:28','2014-03-26 09:30:50'),(71,'ISS World Asia','Kuala Lumpur, Malaysia','News71.png','December 2-4, 2014','www.issworldtraining.com/ISS_AP/','_blank',1,1,0,'en',10,'2014-02-17 15:39:13','2014-02-17 14:47:41');
