INSERT INTO `product` VALUES (1,'FinSpy','FinSpy is a professional Remote Monitoring Software that can be used by Law Enforcement or Intelligence Agencies to monitor the computer systems of targeted persons.','<div align=\"left\"><img width=\"160\" vspace=\"10\" hspace=\"10\" align=\"right\" height=\"250\" alt=\"\" src=\"/GGI/UserFiles/Image/FinFisher_Box_FinSpy.jpg\" /><br />\r\n<div align=\"justify\">FinSpy is a field-proven Remote Monitoring Solution that enables Governments to face nowadays challenges of <strong>monitoring Mobile and Security-Aware Targets</strong> that regularly <strong>change location</strong>, use <strong>encrypted and anonymous communication</strong> channels and <strong>reside in </strong><strong>foreign countries</strong>. Traditional Lawful Interception solutions<strong> face new challenges</strong> that can only be <strong>solved using active systems</strong> like FinSpy:<br /> </div>\r\n</div>\r\n<div align=\"left\">\r\n<ul>\r\n    <li>     Data not transmitted over any network     </li>\r\n    <li>     Encrypted Communication     </li>\r\n    <li>     Targets in foreign countries     </li>\r\n</ul>\r\n<div align=\"justify\"> FinSpy has been <strong>proven successful</strong> in operations around the world <strong>since many years</strong> and valuable intelligence has been acquired about Target Individuals and Organizations.<br />When FinSpy is installed on a computer system or mobile phone it can be<strong> remotely controlled and accessed </strong>as soon as it is connected to the internet/network, <strong>no matter where in the world</strong> the Target System is based.<br /></div>\r\n<br /><strong>Usage Example 1: Intelligence Agency</strong><br />\r\n<div align=\"justify\">FinSpy was installed on several computer systems inside Internet Caf&eacute;&rsquo;s in critical areas in order to monitor them for suspicious activity, especially <strong>Skype communication</strong> to foreign individuals. Using the Webcam, pictures of the Targets were done while they were using the system.<br /></div>\r\n<br /><strong>Usage Example 2: Organized Crime</strong><br />\r\n<div align=\"justify\">FinSpy was <strong>covertly deployed on the mobile phones</strong> of several members of an Organized Crime Group. Using the <strong>GPS tracking</strong> data and <strong>silent calls</strong>, essential information could be gathered from <strong>every meeting that was done</strong> by this group.<br /></div>\r\n</div>','<font size=\"1\" color=\"#ff0000\">Please note that this roadmap is subject to change without further notifications.<br /></font><font size=\"1\"><br />  </font> <font size=\"1\">  </font>\r\n<table width=\"500\" cellpadding=\"0\" border=\"1\" align=\"\" cellspacing=\"0\">\r\n    <colgroup><col width=\"215\" style=\"mso-width-source:userset;mso-width-alt:7862;width:161pt\"></col></colgroup><colgroup><col width=\"285\" style=\"mso-width-source:userset;mso-width-alt:10422;width:214pt\"></col>  </colgroup>\r\n    <tbody>\r\n        <tr height=\"20\" style=\"mso-height-source:userset;height:15.0pt\">\r\n            <td width=\"500\" bgcolor=\"#999999\" height=\"20\" style=\"height:15.0pt;width:375pt\" class=\"xl75\" colspan=\"2\"><strong><font size=\"1\">Release   Date:<span style=\"mso-spacerun:yes\">&nbsp; </span>Q2 2014</font></strong></td>\r\n        </tr>\r\n        <tr height=\"20\" style=\"mso-height-source:userset;height:15.0pt\">\r\n            <td width=\"500\" bgcolor=\"#cccccc\" height=\"20\" style=\"height:15.0pt;width:375pt\" class=\"xl75\" colspan=\"2\"><strong><font size=\"1\">Version:   4.60</font></strong></td>\r\n        </tr>\r\n        <tr height=\"20\" style=\"mso-height-source:userset;height:15.0pt\">\r\n            <td width=\"215\" bgcolor=\"#cccccc\" height=\"20\" style=\"height:15.0pt;border-top:none;\r\n            width:161pt\" class=\"xl72\"><strong><font size=\"1\">Component</font></strong></td>\r\n            <td width=\"285\" bgcolor=\"#cccccc\" style=\"border-top:none;b