  <td width=\"285\" style=\"border-top:none;border-left:none;width:214pt\" class=\"xl66\"><font size=\"1\">Enhance   the WebCam Module with ABE (Application Based Events)</font></td>\r\n        </tr>\r\n        <tr height=\"30\" style=\"height:22.5pt\">\r\n            <td width=\"215\" height=\"30\" style=\"height:22.5pt;border-top:none;\r\n            width:161pt\" class=\"xl71\"><strong><font size=\"1\">Agent/Master/Target</font></strong></td>\r\n            <td width=\"285\" style=\"border-top:none;border-left:none;width:214pt\" class=\"xl66\"><font size=\"1\">enhance   Alert options with: Alert when target changes countries</font></td>\r\n        </tr>\r\n        <tr height=\"30\" style=\"height:22.5pt\">\r\n            <td width=\"215\" height=\"30\" style=\"height:22.5pt;border-top:none;\r\n            width:161pt\" class=\"xl71\"><strong><font size=\"1\">Agent/Master/Target</font></strong></td>\r\n            <td width=\"285\" style=\"border-top:none;border-left:none;width:214pt\" class=\"xl66\"><font size=\"1\">enhance   Alert options with: Alert when target types a predefined keyword(s)</font></td>\r\n        </tr>\r\n        <tr height=\"15\" style=\"height:11.25pt\">\r\n            <td width=\"215\" height=\"15\" style=\"height:11.25pt;border-top:none;\r\n            width:161pt\" class=\"xl71\"><strong><font size=\"1\">Agent</font></strong></td>\r\n            <td width=\"285\" style=\"border-top:none;border-left:none;width:214pt\" class=\"xl66\"><font size=\"1\">Define   Templates - predefined Target configurations</font></td>\r\n        </tr>\r\n    </tbody>\r\n</table>\r\n<font size=\"1\" color=\"#ff0000\"><br /></font><font size=\"1\"> </font>','Product1.png',10,1,1,0,'en',5,'2009-09-22 14:04:58','2014-02-18 12:24:43'),(2,'FinFly LAN','FinFly is a set of products that are used for easy local network and remote infection of target systems. The main features include on the-fly infection of Executable and Screensaver downloads, triggering of Software Updates for well-known software','<img width=\"160\" vspace=\"10\" hspace=\"10\" align=\"right\" height=\"250\" alt=\"\" src=\"/GGI/UserFiles/Image/FinFisher_Box_FlyLite.jpg\" /><br />\r\n<div align=\"justify\">One of the major challenges for Law Enforcement are <strong>mobile Targets</strong> where <strong>no physical access</strong> to the computer system can be achieved and who <strong>do not open any infected Files</strong> which have been sent via E-Mail to their accounts.<br /> </div>\r\n<br />\r\n<div align=\"justify\"> Especially security-aware Targets are <strong>almost impossible to infect</strong> as they keep their systems <strong>up-to-date</strong> and <strong>no exploits</strong> or other Basic Intrusion techniques will lead to success.<br /> <br /> </div>\r\nFinFly LAN was developed to deploy the Remote Monitoring Solution covertly on target systems in Local Area Networks (Wired and Wireless/802.11). It is able to <strong>infect Files</strong> that are downloaded by the Target <strong>on-the-fly</strong> or infect the Target by <strong>sending fake Software Updates</strong> for popular Software.<br />\r\n<div align=\"justify\"> <br /><br /><strong>Usage Example 1: Technical Surveillance Unit</strong><br /><br />A Technical Surveillance Unit was following a Target for weeks without getting the possibility to physical access the target computer. They used FinFly LAN to install the Remote Monitoring Solution on the target computer when he was using a <strong>public Hotspot</strong> at a coffee shop.<br /><br /><strong>Usage Example 2: Anti-Corruption</strong><br /><br />FinFly LAN was used to remotely install the Remote Monitoring Solution on the computer of a Target while he was using it <strong>inside his hotel room </strong>at night. The Agents were in another room <strong>connected to the same network</strong> and manipulated the Websites the Target was visiting to trigger the installation.<br /></div>','<font size=\"1\" color=\"#ff0000\">Please note that this roadmap is subject to change without further notifications.<br /></font><font size=\"1\"><br />  </font> <font size=\"1\">  </font>\r\n<table width=\"500\" cellpadding=\"0\" border=\"1\" align=\"\" cellspacing=\"0\">\r\n    <colgroup><col width=\"215\" style=\"mso-width-source:userset;mso-width-alt:7862;width:161pt\"></col></colgroup><colgroup><col width=\"285\" style=\"mso-width-source:userset;mso-width-alt:10422;width:214pt\"></col>  </colgroup>\r\n    <tbody>\r\n        <tr height=\"15\" style=\"height:11.25pt\">\r\n            <td width=\"500\" bgcolor=\"#999999\" height=\"15\" colspan=\"2\" class=\"xl74\" style=\"height:11.25pt;\r\n            width:375pt\"><strong><font size=\"1\">Release Date:&nbsp;&nbsp;&nbsp; Q2 2014</font></strong></td>\r\n        </tr>\r\n        <tr height=\"15\" style=\"height:11.25pt\">\r\n            <td width=\"500\" bgcolor=\"#cccccc\" height=\"15\" colspan=\"2\" class=\"xl74\" style=\"height:11.25pt;\r\n            width:375pt\"><strong><font size=\"1\">Version: 4.0</font></strong></td>\r\n        </tr>\r\n        <tr height=\"15\" style=\"height:11.25pt\">\r\n            <td width=\"215\" bgcolor=\"#cccccc\" height=\"15\" class=\"xl66\" style=\"height:11.25pt;border-top:none;\r\n            width:161pt\"><strong><font size=\"1\">Feature</font></strong></td>\r\n            <td width=\"285\" bgcolor=\"#cccccc\" class=\"xl66\" style=\"border-top:none;border-left:none;width:214pt\"><strong><font size=\"1\">Description</font></strong></td>\r\n        </tr>\r\n        <tr height=\"15\" style=\"height:11.25pt\">\r\n            <td height=\"15\" class=\"xl72\" style=\"height:11.25pt;border-top:none\"><strong><font size=\"1\">GUI</font></strong></td>\r\n            <td width=\"285\" class=\"xl69\" style=\"border-top:none;border-left:none;width:214pt\"><font size=\"1\">Enhanced   payload compatibility check<span style=\"mso-spacerun:yes\">&nbsp;</span></font></td>\r\n        </tr>\r\n        <tr height=\"15\" style=\"height:11.25p