fflan protocol</font></td>\r\n        </tr>\r\n        <tr height=\"15\" style=\"height:11.25pt\">\r\n            <td height=\"15\" class=\"xl67\" style=\"height:11.25pt;border-top:none\"><strong><font size=\"1\">GUI +   infection proxy</font></strong></td>\r\n            <td width=\"285\" class=\"xl68\" style=\"border-top:none;border-left:none;width:214pt\"><font size=\"1\">add   a \'redirect\' feature to the infection engine</font></td>\r\n        </tr>\r\n    </tbody>\r\n</table>\r\n<br /><font size=\"1\"></font>','Product2.png',5,1,1,0,'en',5,'2009-09-22 14:06:09','2014-02-18 12:26:03'),(3,'FinUSB Suite','The FinUSB Suite is designed to help Law Enforcement and Intelligence Agencies to easily extract important information from a target system with little or no user intervention. The following describes the various components and their \r\nfunctions, features and limitations','<div align=\"left\"><img width=\"160\" vspace=\"10\" hspace=\"10\" align=\"right\" height=\"250\" src=\"/GGI/UserFiles/Image/FinFisher_Box_UsbSuit.jpg\" alt=\"\" /><br />\r\n<div align=\"justify\">The <strong>FinUSB</strong> Suite is a <strong>flexible product</strong> that enables Law Enforcement and Intelligence Agencies to quickly and securely extract <strong>forensic information</strong> from computer systems without the requirement of IT-trained Agents. <br /><br />It has been used in successful operations around the world where valuable intelligence has been acquired about Targets in covert- and overt operations.<br /></div>\r\n</div>\r\n<br />\r\n<div align=\"left\"><strong>Usage Example 1: Covert Operation</strong><br /></div>\r\n<br />\r\n<div align=\"justify\">A source in an Organised Crime Group (OCG) was given a FinUSB Dongle that secretly extracted Account Credentials of Web- and E-Mail accounts and Microsoft Office documents from the Target Systems while the OCG used the USB device to <strong>exchange regular files</strong> like Music, Video and Office Documents.<br /></div>\r\n<br />After returning the USB device to the Head-Quarter the gathered data could be decrypted and analyzed and used to constantly monitor the group remotely.<br /><strong><br /></strong>\r\n<div align=\"justify\">\r\n<div align=\"left\"><strong>Usage Example 2: Technical Surveillance Unit</strong><br /></div>\r\n<br />A Technical Surveillance Unit (TSU) was following a Target that was frequently visiting random Internet Caf&eacute;&rsquo;s which made a monitoring with Trojan-Horse-like technology impossible. The FinUSB was used to extract the <strong>data left on the public Terminals</strong> used by the Target after he left it.<br /><br />Several documents that the Target opened in his web-mail could be recovered this way. The gathered information included crucial Office files, Browsing History through Cookie analysis and more.<br /></div>','<font size=\"1\" color=\"#ff0000\">Please note that this roadmap is subject to change without further notifications.<br /><br /></font>\r\n<table width=\"500\" cellspacing=\"0\" cellpadding=\"0\" border=\"1\" align=\"\">\r\n    <tbody>\r\n        <tr height=\"15\" style=\"height:11.25pt\">\r\n            <td width=\"500\" bgcolor=\"#999999\" height=\"15\" colspan=\"2\" class=\"xl71\" style=\"height:11.25pt;\r\n            width:375pt\"><strong><font size=\"1\">Release Date:&nbsp;&nbsp;&nbsp; Q2 2014</font></strong></td>\r\n        </tr>\r\n        <tr height=\"15\" style=\"height:11.25pt\">\r\n            <td width=\"500\" bgcolor=\"#cccccc\" height=\"15\" colspan=\"2\" class=\"xl71\" style=\"height:11.25pt;\r\n            width:375pt\"><strong><font size=\"1\">Version: 3.7</font></strong></td>\r\n        </tr>\r\n        <tr height=\"15\" style=\"height:11.25pt\">\r\n            <td width=\"215\" bgcolor=\"#cccccc\" height=\"15\" class=\"xl66\" style=\"height:11.25pt;border-top:none;\r\n            width:161pt\"><strong><font size=\"1\">Feature</font></strong></td>\r\n            <td width=\"285\" bgcolor=\"#cccccc\" class=\"xl66\" style=\"border-top:none;border-left:none;width:214pt\"><strong><font size=\"1\">Description</font></strong></td>\r\n        </tr>\r\n        <tr height=\"45\" style=\"height:33.75pt\">\r\n            <td width=\"215\" height=\"45\" class=\"xl67\" style=\"height:33.75pt;border-top:none;\r\n            width:161pt\"><strong><font size=\"1\">Custom Forensics Tool Support</font></strong></td>\r\n            <td width=\"285\" class=\"xl68\" style=\"border-top:none;border-left:none;width:214pt\"><font size=\"1\">Offer   the capability to import in Headquater an executable which can be configured   to run and collect information from target system</font></td>\r\n        </tr>\r\n        <tr height=\"30\" style=\"height:22.5pt\">\r\n            <td width=\"215\" height=\"30\" class=\"xl67\" style=\"height:22.5pt;border-top:none;\r\n            width:161pt\"><strong><font size=\"1\">Gather Information about installed hardware</font></strong></td>\r\n            <td width=\"285\" class=\"xl69\" style=\"border-top:none;border-left:none;width:214pt\"><font size=\"1\">Compile   a list of all existing hardware</font></td>\r\n        </tr>\r\n        <tr height=\"15\" style=\"height:11.25pt\">\r\n            <td width=\"215\" height=\"15\" class=\"xl70\" style=\"height:11.25pt;border-top:none;\r\n            width:161pt\"><strong><font size=\"1\">Extract installed Sofware information</font></strong></td>\r\n            <td width=\"285\" class=\"xl69\" style=\"border-top:none;border-left:none;width:214pt\"><font size=\"1\">Compile   a list of all existing software</font></td>\r\n        </tr>\r\n        <tr height=\"30\" style=\"height:22.5pt\">\r\n            <td width=\"215\" height=\"30\" class=\"xl67\" style=\"height:22.5pt;border-top:none;\r\n            width:161pt\"><strong><font size=\"1\">Obtain the System Services List</font></strong></td>\r\n            <td width=\"285\" class=\"xl69\" style=\"border-top:none;border-left:none;width:214pt\"><font size=\"1\">Compile   a list of all installed services and the states: Running/Stopped,<span style=\"mso-spacerun:yes\">&nbsp; </span>Manual/Automatic</font></td>\r\n        </tr>\r\n        <tr height=\"15\" style=\"height:11.25pt\">\r\n            <td width=\"215\" height=\"15\" class=\"xl67\" style=\"height:11.25pt;border-top:none;\r\n            width:161pt\"><strong><font size=\"1\">RAM Dump</font></strong></td>\r\n            <td width=\"285\" class=\"xl69\" style=\"border-top:none;border-left:none;width:214pt\"><font size=\"1\">Dump   the physical memory into a file</font></td>\r\n        </tr>\r\n        <tr height=\"15\" style=\"height:11.25pt\">\r\n            <td width=\"215\" height=\"15\" class=\"xl67\" style=\"height:11.25pt;border-top:none;\r\n            width:161pt\"><strong><font size=\"1\">Advanced Antivirus Bypass Implementation</font></strong></td>\r\n            <td width=\"285\" class=\"xl69\" style=\"border-top:none;border-left:none;width:214pt\"><font size=\"1\">Improve   the Antivirus Bypassing on the target systems</font></td>\r\n        </tr>\r\n    </tbody>\r\n</table>\r\n<font size=\"1\"><br /></font><font size=\"1\" color=\"#ff0000\"><br /></font>','Product3.png',1,1,1,0,'en',5,'2009-09-22 14:05:26','2014-02-18 13:10:06'),(4,'FinTraining','Security awareness is essential for any government to maintain IT security and successfully prevent threats against IT infrastructures which may result in a loss of confidentiality, data integrity and availability','<div align=\"left\"> <img width=\"160\" vspace=\"10\" hspace=\"10\" align=\"right\" height=\"250\" alt=\"\" src=\"/GGI/UserFiles/Image/FinFisher_Box_Training.jpg\" /><br />\r\n<div align=\"justify\">Security awareness is <strong>essential for any government</strong> to maintain IT security and successfully <strong>prevent threats</strong> against IT infrastructures which may result in a loss of confidentiality, data integrity and availability.<br /><br />On the other side, topics like <strong>CyberWar</strong>, Active Interception and Intelligence Gathering through<strong> IT Intrusion</strong> become more important on a daily basis and require Governments to <strong>build IT Intrusion teams</strong> to<strong> face these new challenges</strong>.  <br /></div>\r\n<br />\r\n<div align=\"justify\">The FinTraining courses are held by <strong>world-class IT Intrusion experts</strong> and are done in<strong> fully practical scenarios</strong> that are focused on <strong>real-life operations</strong> as required by the end-user to solve their <strong>daily challenges</strong>.<br /><br /><strong>FinAdvisory</strong> combines the single trainings into a <strong>professional training and</strong> <strong>consulting program</strong> that builds up or enhances the capabilities of an IT Intrusion team. The Trainings are <strong>fully customized</strong> according to the end-users operational challenges and requirements. In order to ensure full usability of the transferred know-how, <strong>operational in-country support </strong>is provided during the program.<br /></div>\r\n</div>','The Roadmap is currently in progress and will be published soon.','Product4.png',12,1,1,0,'en',5,'2009-09-22 14:05:57','2014-02-18 12:24:09'),(5,'FinIntrusion Kit','The FinIntrusion Kit consists of a wide-range of hard- and software to aid law enforcement and intelligence agencies in gaining access to information in several scenarios utilizing various IT intrusion techniques.','<div align=\"left\"> <img width=\"160\" vspace=\"10\" hspace=\"10\" align=\"right\" height=\"250\" src=\"/GGI/UserFiles/Image/FinFisher_Box_IntusionKit.jpg\" alt=\"\" /><br />\r\n<div align=\"justify\">FinIntrusion Kit was designed and developed by world-class IT Intrusion specialists that have over 10 years experience in their area through their work in several Tiger Teams (Red Teams) in the private and government sector assessing the security of different networks and organizations.   <br /></div>\r\n</div>\r\n<div align=\"justify\"> <br /> </div>\r\nThe FinIntrusion Kit is the result of creating an <strong>up-to-date and covert</strong> operational Kit that can be used for most common <strong>IT Intrusion Operations</strong> in defensive and offensive areas. Current customers include <strong>Military CyberWar Departments</strong>,<strong> Intelligence Agencies, Police Intelligence</strong> and other <strong>Law Enforcement Agencies</strong>.  <br /><br /><strong>Usage Example 1: Technical Surveillance Unit </strong> <br /><br />The FinIntrusion Kit was used to break <strong>the WPA encryption</strong> of a Targets home Wireless network and then monitor his <strong>Webmail (Gmail, Yahoo, &hellip;) and Social Networks (Facebook, MySpace, &hellip;) credentials</strong> which enabled the investigators to <strong>remotely monitor</strong> these accounts from the Head-Quarters without the necessity of being close to the Target. <br /><br /><strong>Usage Example 2: IT Security</strong>  <br /><br />Several customers used the FinIntrusion Kit to successfully <strong>compromise the security</strong> of networks and computer systems for <strong>offensive and defensive</strong> purposes using various Tools and Techniques. <br /><br /><strong>Usage Example 3: Strategic Use-Cases</strong>  <br /><br />The FinIntrusion Kit is widely used to remotely gain access to Target E-Mail Accounts and Target Web-Servers (e.g. Blogs, Discussion Boards) and monitor their activities including Access-Logs and more.','<font size=\"1\" color=\"#ff0000\">Please note that this roadmap is subject to change without further notifications.<br /></font><font size=\"1\"><br />  </font> <font size=\"1\">  </font>\r\n<table width=\"500\" cellpadding=\"0\" border=\"1\" align=\"\" cellspacing=\"0\">\r\n    <colgroup><col width=\"215\" style=\"mso-width-source:userset;mso-width-alt:7862;width:161pt\"></col></colgroup><colgroup><col width=\"285\" style=\"mso-width-source:userset;mso-width-alt:10422;width:214pt\"></col>  </colgroup>\r\n    <tbody>\r\n        <tr height=\"15\" style=\"height:11.25pt\">\r\n            <td width=\"500\" bgcolor=\"#999999\" height=\"15\" style=\"height:11.25pt;\r\n            width:375pt\" class=\"xl73\" colspan=\"2\"><strong><font size=\"1\">Release Date:&nbsp;&nbsp;&nbsp; Q1 2014</font></strong></td>\r\n        </tr>\r\n        <tr height=\"15\" style=\"height:11.25pt\">\r\n            <td width=\"500\" bgcolor=\"#cccccc\" height=\"15\" style=\"height:11.25pt;\r\n            width:375pt\" class=\"xl73\" colspan=\"2\"><strong><font size=\"1\">Version: 5.0</font></strong></td>\r\n        </tr>\r\n        <tr height=\"15\" style=\"height:11.25pt\">\r\n            <td width=\"215\" bgcolor=\"#cccccc\" height=\"15\" style=\"height:11.25pt;border-top:none;\r\n            width:161pt\" class=\"xl66\"><strong><font size=\"1\">Feature</font></strong></td>\r\n            <td width=\"285\" bgcolor=\"#cccccc\" style=\"border-top:none;border-left:none;width:214pt\" class=\"xl66\"><strong><font size=\"1\">Description</font></strong></td>\r\n        </tr>\r\n        <tr height=\"15\" style=\"height:11.25pt\">\r\n            <td height=\"15\" style=\"height:11.25pt;border-top:none\" class=\"xl67\"><strong><font size=\"1\">Wireless -   Cracking - WPS</font></strong></td>\r\n            <td width=\"285\" style=\"border-top:none;border-left:none;width:214pt\" class=\"xl68\"><font size=\"1\">Detect   and Crack WPS encrypted wireless network</font></td>\r\n        </tr>\r\n        <tr height=\"15\" style=\"height:11.25pt\">\r\n            <td height=\"15\" style=\"height:11.25pt;border-top:none\" class=\"xl67\"><strong><font size=\"1\">Wireless   Scanner - permanent scan</font></strong></td>\r\n            <td width=\"285\" style=\"border-top:none;border-left:none;width:214pt\" class=\"xl68\"><font size=\"1\">Implement   a passive Wireless Realtime Scanner</font></td>\r\n        </tr>\r\n        <tr height=\"15\" style=\"height:11.25pt\">\r\n            <td height=\"15\" style=