e\" class=\"xl67\"><strong><font size=\"1\">Network   Sniffer - internal Network</font></strong></td>\r\n            <td width=\"285\" style=\"border-top:none;border-left:none;width:214pt\" class=\"xl68\"><font size=\"1\">start   Network sniffer between two target systems in a (W)Lan</font></td>\r\n        </tr>\r\n        <tr height=\"30\" style=\"height:22.5pt\">\r\n            <td height=\"30\" style=\"height:22.5pt;border-top:none\" class=\"xl67\"><strong><font size=\"1\">Evidence   Protection</font></strong></td>\r\n            <td width=\"285\" style=\"border-top:none;border-left:none;width:214pt\" class=\"xl68\"><font size=\"1\">implement   Evidence Protection for signed Logging and Data Export</font></td>\r\n        </tr>\r\n        <tr height=\"26\" style=\"mso-height-source:userset;height:19.5pt\">\r\n            <td height=\"26\" style=\"height:19.5pt;border-top:none\" class=\"xl67\"><strong><font size=\"1\">Target   Exploitation</font></strong></td>\r\n            <td width=\"285\" style=\"border-top:none;border-left:none;width:214pt\" class=\"xl68\"><font size=\"1\">automatic   target exploitation</font></td>\r\n        </tr>\r\n        <tr height=\"15\" style=\"height:11.25pt\">\r\n            <td height=\"15\" style=\"height:11.25pt;border-top:none\" class=\"xl67\"><strong><font size=\"1\">&nbsp;</font></strong></td>\r\n            <td width=\"285\" style=\"border-top:none;border-left:none;width:214pt\" class=\"xl68\"><font size=\"1\">&nbsp;</font></td>\r\n        </tr>\r\n    </tbody>\r\n</table>\r\n<font size=\"1\" color=\"#ff0000\"><br /></font>','Product5.png',2,1,1,0,'en',5,'2009-09-22 14:05:38','2014-02-18 12:26:56'),(11,'FinFly ISP','FinFly ISP is a strategic, countrywide as well as a tactical (mobile) solution that can be integrated into an ISP’s Access and/or Core Network to remotely install the Remote Monitoring Solution on selected Target Systems.','<div align=\"left\"> <strong><img width=\"160\" vspace=\"10\" hspace=\"10\" align=\"right\" height=\"250\" src=\"/GGI/UserFiles/Image/FinFisher_Box_FlyISP.jpg\" alt=\"\" /><br /></strong>\r\n<div align=\"justify\">In many real-life operations, physical access to in-country Target Systems cannot be achieved and <strong>a covert remote installation</strong> of a Remote Monitoring Solution is required to be able to <strong>monitor the Target from within the Head-Quarter</strong>.  <br /><br />FinFly ISP is a strategic, <strong>countrywide as well as a tactical</strong> (mobile) solution that can be<strong> integrated into an ISP&rsquo;s Access and/or Core Network</strong> to remotely install the Remote Monitoring Solution on selected Target Systems. FinFly ISP makes data available for LEAs which never will be accessible by using the classic telecommunications surveillance / monitoring methods e.g. because of encryption used prior to entering the Internet or because data will never be sent via the Internet at all (e.g. address books, specific documents, time schedules etc.). <br /><br />FinFly ISP appliances are based on <strong>carrier grade server technology</strong> providing a maximum of <strong>reliability and scalability</strong> to meet almost every challenge related to networks&rsquo; topologies. A wide range of Network Interfaces &ndash; <strong>all secured with bypass functions</strong> &ndash; are available for the required active network connectivity. <br /><br />Several passive and active methods of Target identification &ndash; from<strong> inline monitoring</strong> via passive tapping to<strong> interactive communication</strong> between FinFly ISP and the AAA-Servers &ndash; ensure that the Targets are identified and their appropriate traffic will be provided for the infection process. <br /><br />FinFly ISP is able to <strong>infect Files</strong> that are downloaded by the Target <strong>on-the-fly</strong> or infect the Target by <strong>sending fake Software Updates</strong> for popular Software. <br /><br /><strong>Usage Example: Intelligence Agency</strong>  <br /><br />FinFly ISP was deployed in the main Internet Service Providers networks of the country and is actively used to remotely deploy a Remote Monitoring Solution on Target Systems. As the Targets have Dynamic-IP DSL Accounts, they are identified with their Radius Logon Name.</div>\r\n</div>','<font color=\"#ff0000\">Please note that this roadmap is subject to change without further notifications.<br /> </font><font size=\"1\"><br />  </font> <font size=\"1\">  </font>\r\n<table width=\"500\" cellpadding=\"0\" border=\"1\" align=\"\" cellspacing=\"0\">\r\n    <colgroup><col width=\"215\" style=\"mso-width-source:userset;mso-width-alt:7862;width:161pt\"></col></colgroup><colgroup><col width=\"285\" style=\"mso-width-source:userset;mso-width-alt:10422;width:214pt\"></col>  </colgroup>\r\n    <tbody>\r\n        <tr height=\"15\" style=\"height:11.25pt\">\r\n            <td width=\"500\" bgcolor=\"#999999\" height=\"15\" colspan=\"2\" class=\"xl75\" style=\"height:11.25pt;\r\n            width:375pt\"><strong><font size=\"1\">Release Date:&nbsp;&nbsp;&nbsp; Q2 2014</font></strong></td>\r\n        </tr>\r\n        <tr height=\"15\" style=\"height:11.25pt\">\r\n            <td width=\"500\" bgcolor=\"#cccccc\" height=\"15\" colspan=\"2\" class=\"xl74\" style=\"height:11.25pt;\r\n            width:375pt\"><strong><font size=\"1\">Version: 4.5</font></strong></td>\r\n        </tr>\r\n        <tr height=\"15\" style=\"height:11.25pt\">\r\n            <td width=\"215\" bgcolor=\"#cccccc\" height=\"15\" class=\"xl68\" style=\"height:11.25pt;border-top:none;\r\n            width:161pt\"><strong><font size=\"1\">Feature</font></strong></td>\r\n            <td width=\"285\" bgcolor=\"#cccccc\" class=\"xl68\" style=\"border-top:none;border-left:none;width:214pt\"><strong><font size=\"1\">Description</font></strong></td>\r\n        </tr>\r\n        <tr height=\"15\" style=\"height:11.25pt\">\r\n            <td width=\"215\" height=\"15\" class=\"xl69\" st