<strong><font size=\"1\">Description</font></strong></td>\r\n        </tr>\r\n        <tr height=\"30\" style=\"height:22.5pt\">\r\n            <td width=\"215\" height=\"30\" class=\"xl69\" style=\"height:22.5pt;border-top:none;\r\n            width:161pt\"><strong><font size=\"1\">Enhanced compatibility to FinFlyWeb infection methods</font></strong></td>\r\n            <td width=\"285\" class=\"xl70\" style=\"border-top:none;border-left:none;width:214pt\"><font size=\"1\">&nbsp;</font></td>\r\n        </tr>\r\n        <tr height=\"30\" style=\"height:22.5pt\">\r\n            <td width=\"215\" height=\"30\" class=\"xl69\" style=\"height:22.5pt;border-top:none;\r\n            width:161pt\"><strong><font size=\"1\">Update emulators for latest versions of supported programms   (update infection)</font></strong></td>\r\n            <td width=\"285\" class=\"xl70\" style=\"border-top:none;border-left:none;width:214pt\"><font size=\"1\">&nbsp;</font></td>\r\n        </tr>\r\n        <tr height=\"15\" style=\"height:11.25pt\">\r\n            <td width=\"215\" height=\"15\" class=\"xl72\" style=\"height:11.25pt;border-top:none;\r\n            width:161pt\"><strong><font size=\"1\">Infection Filters</font></strong></td>\r\n            <td width=\"285\" class=\"xl66\" style=\"border-top:none;border-left:none;width:214pt\"><font size=\"1\">Web   Infection Filter for User Agent</font></td>\r\n        </tr>\r\n        <tr height=\"30\" style=\"height:22.5pt\">\r\n            <td width=\"215\" height=\"30\" class=\"xl73\" style=\"height:22.5pt;border-top:none;\r\n            width:161pt\"><strong><font size=\"1\">Download replacement. Fully replace downloads on-the-fly</font></strong></td>\r\n            <td width=\"285\" class=\"xl66\" style=\"border-top:none;border-left:none;width:214pt\"><font size=\"1\"><br /></font></td>\r\n        </tr>\r\n        <tr height=\"15\" style=\"height:11.25pt\">\r\n            <td width=\"215\" height=\"15\" class=\"xl66\" style=\"height:11.25pt;border-top:none;\r\n            width:161pt\"><strong><font size=\"1\">&nbsp;</font></strong></td>\r\n            <td width=\"285\" class=\"xl66\" style=\"border-top:none;border-left:none;width:214pt\"><font size=\"1\">&nbsp;</font></td>\r\n        </tr>\r\n    </tbody>\r\n</table>\r\n<font size=\"1\"></font>','Product11.png',6,1,1,0,'en',5,'2009-11-25 18:02:41','2014-02-18 12:25:50'),(12,'FinFireWire','FinFireWire enables the Operator to quickly and covertly bypass the password-protected screens and access the Target System without leaving a trace or harming essential forensic evidence.\r\n','<div align=\"left\"> <img width=\"160\" vspace=\"10\" hspace=\"10\" align=\"right\" height=\"250\" src=\"/GGI/UserFiles/Image/FinFisher_Box_FireWire.jpg\" alt=\"\" /><br />\r\n<div align=\"justify\">Technical Surveillance Units and Forensic Experts often face a situation where they need to access a running computer system without shutting it down in order to prevent data loss or save essential time during an operation. In most cases, the Target System is protected with a <strong>password-enabled Screensaver</strong> or the target user is not logged in and the<strong> Login Screen</strong> is active.  <br /> </div>\r\n</div>\r\n<div align=\"justify\"> <br />FinFireWire enables the Operator to quickly and <strong>covertly bypass the password-protected </strong>screens and access the Target System without leaving a trace or harming essential forensic evidence.<br /><br /><strong>Usage Example 1: Forensic Operation</strong>  <br /><br />A Forensic Unit entered the apartment of a Target and tried to access the computer system. The computer was<strong> switched on but the screen was locked</strong>.  As they were not allowed due to legal reasons to use a Remote Monitoring Solution they would have <strong>lost all data</strong> by switching off the system as the <strong>hard-disk was fully encrypted</strong>. FinFireWire was used to<strong> unlock the running Target System</strong> and enable the Agent to<strong> copy all files</strong> before switching it off and taking it back to the Head-Quarter. <br /><br /><strong>Usage Example 2: Remote Monitoring Installation</strong>  <br /><br />Several customers use the product to <strong>covertly access Target Systems</strong> when physical access can be achieved and install a Remote Monitoring Solution like FinSpy to be able to remotely monitor all activities of the Target.<br /></div>','<font size=\"1\" color=\"#ff0000\">Please note that this roadmap is subject to change without further notifications.<br /></font><font size=\"1\"><br />  </font> <font size=\"1\">  </font>\r\n<table width=\"500\" cellpadding=\"0\" border=\"1\" align=\"\" cellspacing=\"0\">\r\n    <colgroup><col width=\"215\" style=\"mso-width-source:userset;mso-width-alt:7862;width:161pt\"></col></colgroup><colgroup><col width=\"285\" style=\"mso-width-source:userset;mso-width-alt:10422;width:214pt\"></col>  </colgroup>\r\n    <tbody>\r\n        <tr height=\"15\" style=\"height:11.25pt\">\r\n            <td width=\"500\" bgcolor=\"#999999\" height=\"15\" style=\"height:11.25pt;\r\n            width:375pt\" class=\"xl72\" colspan=\"2\"><strong><font size=\"1\">Release Date:&nbsp;&nbsp;&nbsp; Q2 2014</font></strong></td>\r\n        </tr>\r\n        <tr height=\"15\" style=\"height:11.25pt\">\r\n            <td width=\"500\" bgcolor=\"#cccccc\" height=\"15\" style=\"height:11.25pt;\r\n            width:375pt\" class=\"xl72\" colspan=\"2\"><strong><font size=\"1\">Version: 4.50</font></strong></td>\r\n        </tr>\r\n        <tr height=\"15\" style=\"height:11.25pt\">\r\n            <td width=\"215\" bgcolor=\"#cccccc\" height=\"15\" style=\"height:11.25pt;border-top:none;\r\n            width:161pt\" class=\"xl66\"><strong><font size=\"1\">Feature</font></strong></td>\r\n            <td width=\"285\" bgcolor=\"#cccccc\" style=\"border-top:none;border-left:none;width:214pt\" class=\"xl66\"><strong><font size=\"1\">Description</font></strong></td>\r\n        </tr>\r\n        <tr height=\"30\" style=\"height:22.5pt\">\r\n            <td height=\"30\" style=\"height:22.5pt;border-top:none\" class=\"xl67\"><strong><font size=\"1\">target   database update</font></strong></td>\r\n            <td width=\"285\" style=\"border-top:none;border-left:none;width:214pt\" class=\"xl68\"><font size=\"1\">Update   existing database for current OS versions (Windows, MacOSX, Linux)</font></td>\r\n        </tr>\r\n    </tbody>\r\n</table>\r\n<font size=\"1\"></font><font size=\"1\" color=\"#ff0000\"><br /></font>','Product12.png',3,1,1,0,'en',5,'2010-01-14 13:53:24','2014-02-18 12:26:38'),(13,'FinFly Web','FinFly Web is designed to provide remote and covert infection of a Target System by using a wide range of web-based attacks. FinFly Web provides a point-and-click interface enabling the Agent to easily create a custom infection code according to selected modules. Target Systems visiting a prepared website with the implemented infection code will be covertly infected with the configured software. ','<div align=\"left\"> <img width=\"160\" vspace=\"10\" hspace=\"10\" align=\"right\" height=\"250\" src=\"/GGI/UserFiles/Image/FinFisher_Box_FlyWeb.jpg\" alt=\"\" /><br />\r\n<div align=\"justify\">One of the major challenges in using Remote Monitoring Solutions is to install it onto the Target System, especially when only a little information, like an<strong> Email-Address</strong>, is available and <strong>no physical access</strong> can be achieved. <br /></div>\r\n</div>\r\n<br />\r\n<div align=\"justify\">FinFly Web is designed to provide <strong>remote and covert</strong> infection of a Target System by using a wide range of <strong>web-based attacks</strong>.  FinFly Web provides a <strong>point-and-click interface</strong> enabling the Agent to easily <strong>create a custom infection code</strong> according to selected modules.  Target Systems visiting a prepared website with the implemented infection code will be <strong>covertly infected</strong> with the configured software.  <br /></div>\r\n<br /><strong>Usage Example 1: Technical Surveillance Unit</strong>  <br /><br />After profiling a Target, the unit created a <strong>website of interest</strong> for the Target and sent him the <strong>link through a discussion board</strong>. Upon opening the Link to the unit&rsquo;s website, a Remote Monitoring Solution was installed on the Target System and the Target could be <strong>monitored from within the Head-Quarter</strong>.  <br /><br /><strong>Usage Example 2: Intelligence Agency</strong>  <br /><br />The customer deployed <strong>FinFly ISP within the main Internet Service Provider</strong> of their country. It was <strong>combined with FinFly Web</strong> to remotely <strong>infect Targets that visited government offensive websites</strong> by covertly injecting the FinFly Web code into the targeted websites.','<font size=\"1\" color=\"#ff0000\">Please note that this roadmap is subject to change without further notifications.<br /></font><font size=\"1\"><br />  </font> <font size=\"1\">  </font>\r\n<table width=\"500\" cellpadding=\"0\" border=\"1\" align=\"\" cellspacing=\"0\">\r\n    <colgroup><col width=\"215\" style=\"mso-width-source:userset;mso-width-alt:7862;width:161pt\"></col></colgroup><colgroup><col width=\"285\" style=\"mso-width-source:userset;mso-width-alt:10422;width:214pt\"></col>  </colgroup>\r\n    <tbody>\r\n        <tr height=\"15\" style=\"height:11.25pt\">\r\n            <td width=\"500\" bgcolor=\"#999999\" height=\"15\" colspan=\"2\" class=\"xl71\" style=\"height:11.25pt;\r\n            width:375pt\"><strong><font size=\"1\">Release Date: &nbsp;&nbsp; Q2 2014</font></strong></td>\r\n        </tr>\r\n        <tr height=\"15\" style=\"height:11.25pt\">\r\n            <td width=\"500\" bgcolor=\"#cccccc\" height=\"15\" colspan=\"2\" class=\"xl71\" style=\"height:11.25pt;\r\n            width:375pt\"><strong><font size=\"1\">Version: 5.00</fon