250\" alt=\"\" src=\"/GGI/UserFiles/Image/FinFisher_Box_SpyMobile.jpg\" /><br />\r\n<div align=\"justify\">FinSpy Mobile is closing the gap of interception capabilities for Governments for most common <strong>smart phone platforms</strong>. Specifically, organizations <strong>without network or off-air based interception</strong> capabilities can <strong>access Mobile Phones</strong> and intercept the devices with enhanced capabilities. Furthermore, the solution offers access to encrypted communications as well as <strong>data stored on the devices that is not transmitted. Traditional tactical or strategic Interception solutions Face <strong>challenges</strong> that <strong>can only be solved using offensive systems</strong> like FinSpy Mobile:<br /> </strong></div>\r\n<div align=\"left\">\r\n<ul>\r\n    <li>     Data not transmitted over any network and kept on the device     </li>\r\n    <li>     Encrypted Communications in the Air-Interface, which avoid the usage of tactical active or passive Off-Air Systems    </li>\r\n    <li>     End-to-end encryption from the device such as Messengers, Emails or PIN messages     </li>\r\n</ul>\r\n<div align=\"justify\"> FinSpy Mobile has been giving successful results to Government Agencies who gather information remotely <strong>from Target Mobile Phones</strong>.<br /> When FinSpy Mobile is installed on a mobile phone it can be <strong>remotely controlled and monitored</strong> no matter where in the world the Target is located.<br /></div>\r\n<br /><strong>Usage Example 1: Intelligence Agency</strong><br />\r\n<div align=\"justify\">FinSpy Mobile was deployed on <strong>BlackBerry mobile phones</strong> of several Targets to monitor all communications, including <strong>SMS/MMS, Email and BlackBerry Messenger</strong>.<br /></div>\r\n<br /><strong>Usage Example 2: Organized Crime</strong><br />\r\n<div align=\"justify\">FinSpy Mobile was <strong>covertly deployed on the mobile phones</strong> of several members of an Organized Crime Group(OCG). Using the GPS tracking data and <strong>silent calls</strong>, essential information could be gathered from <strong>every meeting that was held</strong> by this group.<br /></div>\r\n</div>\r\n</div>','<font size=\"1\" color=\"#ff0000\">Please note that this roadmap is subject to change without further notifications.<br /><br /></font>\r\n<table width=\"500\" cellpadding=\"0\" border=\"1\" align=\"\" cellspacing=\"0\">\r\n    <tbody>\r\n        <tr height=\"20\" style=\"mso-height-source:userset;height:15.0pt\">\r\n            <td width=\"500\" bgcolor=\"#999999\" height=\"20\" colspan=\"2\" class=\"xl77\" style=\"height:15.0pt;width:375pt\"><strong><font size=\"1\">Release   Date:<span style=\"mso-spacerun:yes\">&nbsp; </span>Q2 2014</font></strong></td>\r\n        </tr>\r\n        <tr height=\"20\" style=\"mso-height-source:userset;height:15.0pt\">\r\n            <td width=\"500\" bgcolor=\"#cccccc\" height=\"20\" colspan=\"2\" class=\"xl77\" style=\"height:15.0pt;width:375pt\"><strong><font size=\"1\">Version:   4.60</font></strong></td>\r\n        </tr>\r\n        <tr height=\"20\" style=\"mso-height-source:userset;height:15.0pt\">\r\n            <td bgcolor=\"#cccccc\" height=\"20\" class=\"xl74\" style=\"height:15.0pt;border-top:none\"><strong><font size=\"1\">Component</font></strong></td>\r\n            <td width=\"285\" bgcolor=\"#cccccc\" class=\"xl73\" style=\"border-top:none;border-left:none;width:214pt\"><strong><font size=\"1\">Feature/Enhancement</font></strong></td>\r\n        </tr>\r\n        <tr height=\"15\" style=\"height:11.25pt\">\r\n            <td height=\"15\" class=\"xl70\" style=\"height:11.25pt;border-top:none\"><strong><font size=\"1\">Mobile Target   - All (supported) Platforms</font></strong></td>\r\n            <td class=\"xl69\" style=\"border-top:none;border-left:none\"><font size=\"1\">Update Capabilities   for the infection</font></td>\r\n        </tr>\r\n        <tr height=\"15\" style=\"height:11.25pt\">\r\n            <td height=\"15\" class=\"xl70\" style=\"height:11.25pt;border-top:none\"><strong><font size=\"1\">Mobile Target   - All (supported) Platforms</font></strong></td>\r\n            <td class=\"xl69\" style=\"border-top:none;border-left:none\"><font size=\"1\">New Data Collection   Module: Line Messenger</font></td>\r\n        </tr>\r\n        <tr height=\"15\" style=\"height:11.25pt\">\r\n            <td height=\"15\" class=\"xl70\" style=\"height:11.25pt;border-top:none\"><strong><font size=\"1\">Mobile Target   - All (supported) Platforms</font></strong></td>\r\n            <td class=\"xl69\" style=\"border-top:none;border-left:none\"><font size=\"1\">New Data Collection   Module: Viber Messenger</font></td>\r\n        </tr>\r\n        <tr height=\"15\" style=\"height:11.25pt\">\r\n            <td height=\"15\" class=\"xl70\" style=\"height:11.25pt;border-top:none\"><strong><font size=\"1\">Mobile Target   - All (supported) Platforms</font></strong></td>\r\n            <td class=\"xl69\" style=\"border-top:none;border-left:none\"><font size=\"1\">Record Microphone</font></td>\r\n        </tr>\r\n        <tr height=\"15\" style=\"height:11.25pt\">\r\n            <td height=\"15\" class=\"xl70\" style=\"height:11.25pt;border-top:none\"><strong><font size=\"1\">Mobile Target   - Support for Blackberry 10</font></strong></td>\r\n            <td class=\"xl69\" style=\"border-top:none;border-left:none\"><font size=\"1\">Core Functionalities</font></td>\r\n        </tr>\r\n        <tr height=\"15\" style=\"height:11.25pt\">\r\n            <td height=\"15\" class=\"xl70\" style=\"height:11.25pt;border-top:none\"><strong><font size=\"1\">Mobile Target   - Android</font></strong></td>\r\n            <td class=\"xl69\" style=\"border-top:none;border-left:none\"><font size=\"1\">Exploit Deployment   Platform</font></td>\r\n        </tr>\r\n        <tr height=\"15\" style=\"height:11.25pt\">\r\n            <td height=\"15\" class=\"xl72\" style=\"height:11.25pt;bor