</td>\r\n        </tr>\r\n        <tr height=\"15\" style=\"height:11.25pt\">\r\n            <td height=\"15\" class=\"xl72\" style=\"height:11.25pt;border-top:none\"><strong><font size=\"1\">Mobile Target   - Windows Mobile</font></strong></td>\r\n            <td class=\"xl75\" style=\"border-top:none;border-left:none\"><font size=\"1\">Target Actions: Drain   Battery</font></td>\r\n        </tr>\r\n        <tr height=\"15\" style=\"height:11.25pt\">\r\n            <td height=\"15\" class=\"xl69\" style=\"height:11.25pt;border-top:none\"><strong><font size=\"1\">&nbsp;</font></strong></td>\r\n            <td width=\"285\" class=\"xl67\" style=\"border-top:none;border-left:none;width:214pt\"><font size=\"1\">&nbsp;</font></td>\r\n        </tr>\r\n    </tbody>\r\n</table>\r\n<font size=\"1\" color=\"#ff0000\"><br /></font><font size=\"1\"> </font>','Product14.png',11,1,1,0,'en',5,'2010-02-02 18:10:57','2014-02-18 12:24:22'),(16,'FinFly USB','The FinFly USB provides an easy-to-use and reliable way of installing a Remote Monitoring Solution on computer systems when physical access is available.','<div align=\"left\"><img width=\"160\" vspace=\"10\" hspace=\"10\" align=\"right\" height=\"250\" src=\"/GGI/UserFiles/Image/FinFisher_Box_FlyUsb.jpg\" alt=\"\" /><br />\r\n<div align=\"justify\">The <strong>FinFly USB</strong> provides an easy-to-use and reliable way of installing a Remote Monitoring Solution on computer systems when physical access is available. <br /><br />It <strong>automatically installs the configured software</strong> on insertion into the computer with little or no userinteraction and <strong>does not require IT-trained Agents</strong> when used in operations. It can be used against <strong>multiple systems</strong> before being returned to Headquarters.<br /></div>\r\n</div>\r\n<div align=\"justify\"> <br /><strong>Usage Example 1: Technical Surveillance Unit</strong><br /><br />In several countries, the <strong>FinFly USB</strong> was used to covertly install a Remote Monitoring Solution in <strong>Internet Cafes and Business Centers</strong> by simply <strong>inserting the device into the Target Systems</strong> so they could be monitored remotely as required<br /><br /><strong>Usage Example 2: Intelligence Agency</strong><br /><br />A Source in a domestic terror group was given a FinFly USB that <strong>secretly installed a Remote Monitoring</strong> Solution on several computer systems of the group when they were using the device to exchange documents between each other. The Target Systems were then <strong>remotely monitored from Headquarters</strong> and the FinFly USB was returned by the Source.</div>','<font color=\"#ff0000\">Please note that this roadmap is subject to change without further notifications.<br /> </font><font size=\"1\"><br />  </font> <font size=\"1\">  </font>\r\n<table width=\"500\" cellpadding=\"0\" border=\"1\" align=\"\" cellspacing=\"0\">\r\n    <colgroup><col width=\"215\" style=\"mso-width-source:userset;mso-width-alt:7862;width:161pt\"></col></colgroup><colgroup><col width=\"285\" style=\"mso-width-source:userset;mso-width-alt:10422;width:214pt\"></col>  </colgroup>\r\n    <tbody>\r\n        <tr height=\"15\" style=\"height:11.25pt\">\r\n            <td width=\"500\" bgcolor=\"#999999\" height=\"15\" colspan=\"2\" class=\"xl70\" style=\"border-right:.5pt solid black;\r\n            height:11.25pt;width:375pt\"><strong><font size=\"1\">Release Date:&nbsp;&nbsp;&nbsp; Q4 2014</font></strong></td>\r\n        </tr>\r\n        <tr height=\"15\" style=\"height:11.25pt\">\r\n            <td width=\"500\" bgcolor=\"#cccccc\" height=\"15\" colspan=\"2\" class=\"xl70\" style=\"border-right:.5pt solid black;\r\n            height:11.25pt;width:375pt\"><strong><font size=\"1\">Version: 3.00</font></strong></td>\r\n        </tr>\r\n        <tr height=\"15\" style=\"height:11.25pt\">\r\n            <td width=\"215\" bgcolor=\"#cccccc\" height=\"15\" class=\"xl66\" style=\"height:11.25pt;border-top:none;\r\n            width:161pt\"><strong><font size=\"1\">Feature</font></strong></td>\r\n            <td width=\"285\" bgcolor=\"#cccccc\" class=\"xl67\" style=\"border-top:none;width:214pt\"><strong><font size=\"1\">Description</font></strong></td>\r\n        </tr>\r\n        <tr height=\"15\" style=\"height:11.25pt\">\r\n            <td width=\"215\" height=\"15\" class=\"xl68\" style=\"height:11.25pt;border-top:none;\r\n            width:161pt\"><strong><font size=\"1\">Offline Extraction</font></strong></td>\r\n            <td width=\"285\" class=\"xl69\" style=\"border-top:none;width:214pt\"><font size=\"1\">Extract data   from offline target</font></td>\r\n        </tr>\r\n    </tbody>\r\n</table>','Product16.png',4,1,1,0,'en',5,'2010-03-12 16:40:55','2014-02-18 12:26:18'),(17,'FinFly Net','In many real-life operations, physical access to in-country\r\ntarget systems cannot be achieved.\r\nTo solve this, a covert remote installation of a Remote\r\nMonitoring Solution is required to be able to monitor the\r\nTarget from within Headquarters.','<div align=\"left\"> <img width=\"160\" vspace=\"10\" hspace=\"10\" align=\"right\" height=\"250\" src=\"/GGI/UserFiles/Image/FinFisher_Box_FinFlyNet.jpg\" alt=\"\" /><br />\r\n<div align=\"justify\">In many real-life operations, physical access to in-country target systems cannot be <br />achieved. To solve this, a <strong>covert remote installation </strong>of a Remote Monitoring Solution is required to be able to <strong>monitor the Target from within Headquarters</strong>.  <br />  </div>\r\n<div align=\"justify\"> <br /><strong>FinFly NET</strong> is a <strong>tactical</strong> (portable) solution to be deployed in a <strong>&bdquo;friendly&ldquo; LAN environment</strong> (like hotels, hotspots, companies - with support of the network owner) on short notice, to remotely install the Remote Monitoring Solution on selected target systems. FinFly NET is based on a <strong>high performance portable PC</strong> combined with a <strong>Management Notebook</strong> to provide maximum mobility and flexibility in the targeted networks. A wide range of Network Interface Cards &ndash; all <strong>secured with bypass functions</strong> &ndash; is available for the required active network connectivity. <br /> <br />The end-user can select several <strong>sophisticated passive methods of Target and Traffic Identification</strong>. These vary from DHCP/RADIUS Monitoring (MAC-Addresses, User Names), Flow Monitoring and Finger-Printing. Each method can be used either stand-alone or combined, to provide maximum success identifying the targets of interest. Of course fixed IP-Addresses can be used too. It is able to <strong>patch Files that are downloaded by the Target on-the-fly, send fake Software Updates for popular Software or <strong>inject the Payload into visited Websites</strong>.<br /></strong></div>\r\n<br /><br /><strong>Usage Example LAN: Intelligence Agency</strong>  <br /><br />A FinFly NET is deployed i.e. in a hotel&rsquo;s LAN in front of the DSLModem before the IP-traffic is transmitted to an Internet Service Provider network. <br /><br /> Targets of interest are <strong>identified in the IP-traffic by various passive profiling</strong> and identification methods and the Remote Monitoring Solution will be deployed on the positively identified Target Systems.<br /></div>','<font size=\"1\" color=\"#ff0000\">Please note that this roadmap is subject to change without further notifications.<br /><br /></font><font size=\"1\">  </font> <font size=\"1\">  </font>\r\n<table width=\"500\" cellpadding=\"0\" border=\"1\" align=\"\" cellspacing=\"0\">\r\n    <colgroup><col width=\"215\" style=\"mso-width-source:userset;mso-width-alt:7862;width:161pt\"></col></colgroup><colgroup><col width=\"285\" style=\"mso-width-source:userset;mso-width-alt:10422;width:214pt\"></col>  </colgroup>\r\n    <tbody>\r\n        <tr height=\"15\" style=\"height:11.25pt\">\r\n            <td width=\"500\" bgcolor=\"#999999\" height=\"15\" colspan=\"2\" class=\"xl77\" style=\"height:11.25pt;\r\n            width:375pt\"><strong><font size=\"1\">Release Date:&nbsp;&nbsp;&nbsp; Q2 2014</font></strong></td>\r\n        </tr>\r\n        <tr height=\"15\" style=\"height:11.25pt\">\r\n            <td width=\"500\" bgcolor=\"#cccccc\" height=\"15\" colspan=\"2\" class=\"xl76\" style=\"height:11.25pt;\r\n            width:375pt\"><strong><font size=\"1\">Version: 4.5</font></strong></td>\r\n        </tr>\r\n        <tr height=\"15\" style=\"height:11.25pt\">\r\n            <td bgcolor=\"#cccccc\" height=\"15\" class=\"xl73\" style=\"height:11.25pt;border-top:none\"><strong><font size=\"1\">Feature</font></strong></td>\r\n            <td width=\"285\" bgcolor=\"#cccccc\" class=\"xl70\" style=\"border-top:none;border-left:none;width:214pt\"><strong><font size=\"1\">Description</font></strong></td>\r\n        </tr>\r\n        <tr height=\"15\" style=\"height:11.25pt\">\r\n            <td height=\"15\" class=\"xl66\" style=\"height:11.25pt;border-top:none\"><strong><font size=\"1\">GUI</font></strong></td>\r\n            <td width=\"285\" class=\"xl67\" style=\"border-top:none;border-left:none;width:214pt\"><font size=\"1\">Enhanced   payload compatibility check<span style=\"mso-spacerun:yes\">&nbsp;</span></font></td>\r\n        </tr>\r\n        <tr height=\"15\" style=\"height:11.25pt\">\r\n            <td height=\"15\" class=\"xl66\" style=\"height:11.25pt;border-top:none\"><strong><font size=\"1\">Infection   proxy</font></strong></td>\r\n            <td width=\"285\" class=\"xl67\" style=\"border-top:none;border-left:none;width:214pt\"><font size=\"1\">Enhanced   compatibility to FinFlyWeb infection methods</font></td>\r\n        </tr>\r\n        <tr height=\"30\" style=\"height:22.5pt\">\r\n            <td height=\"30\" class=\"xl66\" style=\"height:22.5pt;border-top:none\"><strong><font size=\"1\">GUI +<span style=\"mso-spacerun:yes\">&nbsp; </span>proxy</font></strong></td>\r\n            <td width=\"285\" class=\"xl67\" style=\"border-top:none;border-left:none;width:214pt\"><font size=\"1\">Update   emulators for latest versions of supported programms (update infection)</font></td>\r\n        </tr>\r\n        <tr height=\"15\" style=\"height:11.25pt\">\r\n            <td height=\"15\" colspan=\"2\" class=\"xl78\" style=\"height:11.25pt\"><strong><font size=\"1\">&nbsp;</font></strong></td>\r\n        </tr>\r\n        <tr height=\"15\" style=\"height:11.25pt\">\r\n            <td bgcolor=\"#999999\" height=\"15\" colspan=\"2\" class=\"xl77\" style=\"height:11.25pt\"><strong><font size=\"1\">Release   Date:&nbsp;&nbsp;&nbsp; Q4 2014</font></strong></td>\r\n        </tr>\r\n        <tr height=\"15\" style=\"height:11.25pt\">\r\n            <td width=\"500\" bgcolor=\"#cccccc\" height=\"15\" colspan=\"2\" class=\"xl76\" style=\"height:11.25pt;\r\n            width:375pt\"><strong><font size=\"1\">Version: 5.0</font></strong></td>\r\n        </tr>\r\n        <tr height=\"15\" style=\"height:11.25pt\">\r\n            <td bgcolor=\"#cccccc\" height=\"15\" class=\"xl73\" style=\"height:11.25pt;border-top:none\"><strong><font size=\"1\">Feature</font></strong></td>\r\n            <td width=\"285\" bgcolor=\"#cccccc\" class=\"xl70\" style=\"border-top:none;border-left:none;width:214pt\"><strong><font size=\"1\">Description</font></strong></td>\r\n        </tr>\r\n        <tr height=\"15\" style=\"height:11.25pt\">\r\n            <td height=\"15\" class=\"xl66\" style=\"height:11.25pt;border-top:none\"><strong><font size=\"1\">Infection   proxy</font></strong></td>\r\n            <td width=\"285\" class=\"xl67\" style=\"border-top:none;border-left:none;width:214pt\"><font size=\"1\">Enhanced   compatibility to FinFlyWeb infection methods</font></td>\r\n        </tr>\r\n        <tr height=\"30\" style=\"height:22.5pt\">\r\n            <td height=\"30\" class=\"xl66\" style=\"height:22.5pt;border-top:none\"><strong><font size=\"1\">GUI +<span style=\"mso-spacerun:yes\">&nbsp; </span>proxy</font></strong></td>\r\n            <td width=\"285\" class=\"xl67\" style=\"border-top:none;border-left:none;width:214pt\"><font size=\"1\">Update   emulators for latest versions of supported programms (update infection)</font></td>\r\n        </tr>\r\n        <tr height=\"15\" style=\"height:11.25pt\">\r\n            <td height=\"15\" class=\"xl74\" style=\"height:11.25pt;border-top:none\"><strong><font size=\"1\">Infection   proxy</font></strong></td>\r\n            <td width=\"285\" class=\"xl75\" style=\"border-top:none;border-left:none;width:214pt\"><font size=\"1\">Infection   Filters</font></td>\r\n        </tr>\r\n        <tr height=\"26\" style=\"mso-height-source:userset;height:19.5pt\">\r\n            <td height=\"26\" class=\"xl66\" style=\"height:19.5pt;border-top:none\"><strong><font size=\"1\">GUI +<span style=\"mso-spacerun:yes\">&nbsp; </span>proxy</font></strong></td>\r\n            <td width=\"285\" class=\"xl72\" style=\"border-top:none;border-left:none;width:214pt\"><font size=\"1\">Download   replacement. Fully replace downloads on-the-fly</font></td>\r\n        </tr>\r\n        <tr height=\"15\" style=\"height:11.25pt\">\r\n            <td height=\"15\" class=\"xl66\" style=\"height:11.25pt;border-top:none\"><strong><font size=\"1\">New Feature</font></strong></td>\r\n            <td width=\"285\" class=\"xl67\" style=\"border-top:none;border-left:none;width:214pt\"><font size=\"1\">Web   Infection Filter for User Agent</font></td>\r\n        </tr>\r\n        <tr height=\"15\" style=\"height:11.25pt\">\r\n            <td height=\"15\" class=\"xl68\" style=\"height:11.25pt;border-top:none\"><strong><font size=\"1\">&nbsp;</font></strong></td>\r\n            <td width=\"285\" class=\"xl67\" style=\"border-top:none;border-left:none;width:214pt\"><font size=\"1\">&nbsp;</font></td>\r\n        </tr>\r\n    </tbody>\r\n</table>\r\n<font size=\"1\"></font><font size=\"1\"><br /><font color=\"#ff0000\">  </font></font> <font size=\"1\">  </font>','Product17.png',8,1,1,0,'en',5,'2012-05-10 10:00:05','2014-02-18 12:25:23'),(18,'FinFly Exploit','The FinFly Exploit Portal offers access to a large library of 0-Day and 1-Day Exploits for popular software like Microsoft® Office, Internet Explorer, Adobe Acrobat Reader, and many more.\r\nIn most scenarios, 0-Day Exploits provide an extremely powerful and reliable way to deploy Remote Monitoring Solutions by exploiting unpatched vulnerabilities in Software the Target is using.','<div align=\"left\"> <img width=\"160\" vspace=\"10\" hspace=\"10\" align=\"right\" height=\"250\" src=\"/GGI/UserFiles/Image/FinFisher_Box_FinFlyExploit.jpg\" alt=\"\" /><br />\r\n<div align=\"justify\">Standard Deployment methods for Remote Monitoring Solutions can <strong>often not be applied</strong> when dealing <strong>with well-trained and extremely careful Targets</strong> as they are familiar with common Deployment techniques and tools. <br /> <br /> In most scenarios, <strong>0-Day Exploits</strong> provide an extremely powerful and <strong>reliable way to deploy Remote Monitoring Solutions</strong> by exploiting <strong>unpatched vulnerabilities</strong> in Software the Target is using.<br /> </div>\r\n</div>\r\n<div align=\"justify\"> <br /> </div>\r\nThe FinFly Exploit Portal offers access to a <strong>large library</strong> of 0-Day and 1-Day Exploits for popular software like <strong>Microsoft&reg; Office, Internet Explorer, Adobe Acrobat Reader, and many more</strong>.<br /><br /><strong>Usage Example 1: High-Tech Crime Unit</strong> <br /><br />A High-Tech Crime Unit was <strong>investigating a Cyber-Crime</strong> and needed to deploy a Remote Monitoring Solution on a Target System. They used an Adobe Acrobat Reader 0-Day Exploit and sent a prepared PDF file via Email to the Target. The Remote Monitoring Solution was automatically deployed once the Target opened the file.<br /><br /><strong>Usage Example 2: Intelligence Agency</strong>  <br /><br />A Target was identified <strong>within</strong> a Discussion Board but no direct or Email contact was possible. The Agency created a Webserver containing an <strong>Internet Explorer 0-day Exploit</strong> which deployed the Payload on the Target System <strong>once the Target opened the URL</strong> that was sent to him through a private message in the Discussion Board.','The Roadmap is currently in progress and will be published soon.','Product18.png',9,1,1,0,'en',5,'2012-05-10 12:48:42','2014-02-18 12:24:54');
