INSERT INTO `product_faq` VALUES (11,'Q: What Operation Systems are supported?','A: Windows 2000, Windows XP, Windows Vista, Windows 7, Mac OSX and Linux.','2010-01-14',1,-1,1,1,0,'en',5,'2010-01-14 12:22:06','2011-05-25 13:37:56'),(12,'Q: What Operation Systems are supported?','A: Windows 2000, Windows XP, Windows Vista and Windows 7','2010-01-14',3,-1,4,1,0,'en',5,'2010-01-14 12:27:12','2010-01-14 12:27:12'),(13,'Q: Does it work when the Computer is switched off or locked?','A: The Computer needs to be turned on and the User needs to be logged in as the Auto Run Feature of the USB port would not be activated otherwise.\r\nFinUSB: Windows Logon Bypass is a bootable CD-Rom that helps bypassing the Windows Logon without requiring the real user password.\r\n','2010-01-14',3,-1,5,1,0,'en',5,'2010-01-14 12:28:21','2010-01-14 12:28:21'),(14,'Q: Is the data lost when the device is removed during the operation?','A: Only the file that is currently copied is lost, the already copied data will be available.','2010-01-14',3,-1,6,1,0,'en',5,'2010-01-14 12:29:07','2010-01-14 12:29:07'),(15,'Q: Can the device be used multiple times before downloading the data to the HQ system?','A: Yes, the device can be used until the storage is full.','2010-01-14',3,-1,7,1,0,'en',5,'2010-01-14 12:30:26','2010-01-14 12:30:26'),(16,'Q: Can the FinUSB HQ component be installed on a present system within the head-quarter?','A: Yes, a CD-Rom with the installer is included that can be installed on systems running Windows 7.','2010-01-14',3,-1,8,1,0,'en',5,'2010-01-14 12:30:47','2010-01-14 12:30:47'),(17,'Q: What is the current capacity of the USB Dongles?','A: We currently support 16GB which will be updated regularly. Please ask for the current available capacity.','2010-01-14',3,-1,9,1,0,'en',5,'2010-01-14 12:31:11','2010-01-14 12:31:11'),(18,'Q: What evidences can be found on the Computer when FinUSB applied?','A: In the registry will be the information that a SanDisk Cruzer USB dongle was attached to the system. Depending on the used Anti-Virus product, a log entry inside it might exist.','2010-01-14',3,-1,10,1,0,'en',5,'2010-01-14 12:31:37','2010-01-14 12:31:37'),(19,'Q: Can an individual Dongle be purchased?','A: Gamma International provides the FinUSB Suite as a set operating with the FinUSB HQ preinstalled on a notebook and a set of 10 dongles. Please get in touch with us for specific requests.','2010-01-14',3,-1,11,1,0,'en',5,'2010-01-14 12:32:02','2010-01-14 12:32:02'),(20,'Q: Can FinUSB be used in combination with other products of the Gamma Family?','A: Yes, data gathered by the FinUSB Suite can be used in conjunction with the FinIntrusion Kit in order to covertly access accounts, attack websites visited by the Target and use the information for identifying the Target on local networks.','2010-01-14',3,-1,12,1,0,'en',5,'2010-01-14 12:32:27','2010-01-14 12:32:27'),(21,'Q: Can FinUSB recover deleted documents?','A: FinUSB offers the feature to copy files that are currently inside the Recycle-Bin. It currently does not have a feature to recover already deleted documents.','2010-01-14',3,-1,13,1,0,'en',5,'2010-01-14 12:32:54','2010-01-14 12:32:54'),(22,'Q: Can I hack into any Webmail account with the kit?','A: Only if the Targets choose weak passwords.','2010-01-14',5,-1,1,1,0,'en',5,'2010-01-14 12:55:06','2010-01-14 12:55:06'),(23,'Q: Can I hack into any target systems I select?','A: It requires a complicated process and wide knowledge to gain access to computers and networks which is shown partially during the trainings.','2010-01-14',5,-1,2,1,0,'en',5,'2010-01-14 12:55:49','2010-01-14 12:55:49'),(24,'Q: Does it support WiMax, UMTS or GSM?','A: Currently only WLAN (802.11) is supported.','2010-01-14',5,-1,3,1,0,'en',5,'2010-01-14 12:56:20','2011-05-25 13:29:15'),(25,'Q: Can I hack into mobile phones using the kit?','A: Only into a selection of several old models (Nokia and Sony Ericsson) using Bluetooth.','2010-01-14',5,-1,4,1,1,'en',5,'2010-01-14 12:57:01','2011-05-25 13:28:48'),(26,'Q: What is the difference to WLAN catchers?','A: This is a fully-loaded IT Intrusion kit that is mainly used for active or combined attacks, not a passive network sniffer.','2010-01-14',5,-1,5,1,0,'en',5,'2010-01-14 12:57:33','2010-01-14 12:57:33'),(27,'Q: What is the scope of delivery of FinSpy?','- FinSpy Master Server to establish the       communication to the Infected PCs </br>\r\n- FinSpy Agent PC to access the infected PCs </br>\r\n(number depending on the commercial requirements)</br>\r\n- FinSpy Target, the Trojan Horse </br>\r\n- Common Parts:\r\n<BLOCKQUOTE>\r\n    o	Portable Rack </br>\r\n    o	Switch</br>\r\n    o	LAN Cables</br>\r\n    o	MMI / Keyboard Switch</br>\r\n</BLOCKQUOTE>','2010-01-14',1,-1,2,1,1,'en',5,'2010-01-14 13:01:44','2011-05-25 13:38:25'),(28,'Q: Can you infect any type of file?','A: With the software you can currently infect:</br>\r\n<BLOCKQUOTE>\r\n• Executables and Screen-Savers (fully hidden)</br>\r\n• Office Documents (Macros)</br>\r\n• JPEG, PDF, MP3 Files, ... (faking the file extension)  </br>\r\n</BLOCKQUOTE>\r\nDuring the training, techniques are shown to abuse vulnerabilities in client software that enables the agent to infect other file-types like PDF (depending on the viewer application used on the target system).','2010-01-14',1,-1,3,1,0,'en',5,'2010-01-14 13:18:05','2011-05-25 14:07:52'),(29,'Q: Can the presence of the Trojan be discovered on an infected computer?','A: Very advanced measurements have been taken to hide the presence on target systems and its communication. There is always a possibility for such software to be discovered but it requires huge effort and very skilled professional knowledge to do so. Even if discovered it is not possible to trace the Trojan back to the Head-Quarter.','2010-01-14',1,-1,4,1,0,'en',5,'2010-01-14 13:20:40','2010-01-14 13:20:40'),(30,'Q: How many targets can be monitored in parallel?','A: By default, the software is limited to 30 parallel targets. Depending on the amount of data that is transferred, a couple hundred targets can be monitored with one system. This limitation is rather commercially than technical.','2010-01-14',1,-1,5,1,0,'en',5,'2010-01-14 13:21:11','2010-01-14 13:21:11'),(31,'Q: Can I permanently infect computers in internet cafes?','A: FinSpy is infecting the MBR of the hard-disk and is therefore able to survive even a removal from internet café software.','2010-01-14',1,-1,6,1,0,'en',5,'2010-01-14 13:21:37','2010-01-14 13:21:37'),(32,'Q: Will any Firewall or Anti-Virus system detect the Trojan horse?','A: Currently only a few tested Anti-Virus systems are able to detect the Trojan which will result in a popup being shown to the user on installation. After accepting the popup, the Trojan works without problems.','2010-01-14',1,-1,7,1,0,'en',5,'2010-01-14 13:21:55','2010-01-14 13:21:55'),(33,'Q: What communication method does the Trojan horse use to send out data?','A: The Trojan sends out its data via common ports like DNS, HTTP, POP, SMTP and more. This technique bypasses most Firewalls and IDS as these services are allowed by default in order to enable internet access for the client systems.','2010-01-14',1,-1,8,1,0,'en',5,'2010-01-14 13:22:21','2010-01-14 13:22:21'),(34,'Q: What evidences are being seen on the computer that a Trojan horse is running on it?','A: In a forensic analysis of the system, a new Windows driver and several hidden encrypted files can be discovered. Due to the use of public key cryptography, it is not possible to decrypt and analyze these files.','2010-01-14',1,-1,9,1,0,'en',5,'2010-01-14 13:22:50','2010-01-14 13:22:50'),(35,'Q: How can I infect targets computers?','A: There are several ways of infecting a target system:</br>\r\n<BLOCKQUOTE>\r\na.) Using FinFly products</br>\r\nb.) Via an email infection and attach the Trojan with an executable file such a PC game or Screensaver. </br>\r\nc.) With the USB Infection dongle\r\n</BLOCKQUOTE>','2010-01-14',1,-1,10,1,0,'en',5,'2010-01-14 13:24:45','2010-01-14 13:24:45'),(36,'Q: How can I delete the FinSpy Target System again?','A: The FinSpy Agent can define a delete date or can send a command to tell the Trojan horse to delete itself immediately.','2010-01-14',1,-1,11,1,0,'en',5,'2010-01-14 13:26:43','2010-01-14 13:26:43'),(37,'Q: Can FinFly LAN be obtained as a stand-alone system?','A: Yes, it can be installed on Ubuntu Karmic based systems.','2010-01-14',2,-1,1,1,0,'en',5,'2010-01-14 13:46:09','2011-06-27 12:54:17'),(38,'Q: Does it help to infect computers over the internet?','A: FinFly LAN only works in Local Area Networks (Wired or Wireless).','2010-01-14',2,-1,2,1,0,'en',5,'2010-01-14 13:46:41','2011-06-27 12:54:42'),(39,'Q: Can it attach the Trojan to any downloaded file?','A: Currently it can attach the Trojan to downloaded Windows executables and Screensavers. ','2010-01-14',2,-1,3,1,0,'en',5,'2010-01-14 13:47:11','2011-05-25 13:31:51'),(40,'Q: How are Targets identified?','A: Targets are selected and identified by IP address, Hostname, Operating System.','2010-01-14',2,-1,4,1,0,'en',5,'2010-01-14 13:47:30','2011-05-25 13:32:33'),(41,'Q: How do I find the IP address of my Target?','A: The computer name can of all systems be displayed. Several IT Intrusion techniques for this topic are shown during the training.','2010-01-14',2,-1,5,1,0,'en',5,'2010-01-14 13:47:58','2010-01-14 13:47:58'),(42,'Q: How are Targets identified?','A: By IP address or Radius login name.','2010-01-14',11,-1,1,1,0,'en',5,'2010-01-14 13:50:01','2010-01-14 13:50:01'),(43,'Q: If more computers share the same IP address (normal Home/Company network scenario), are all of them infected?','A: Yes, for a targeted infection within larger local area networks, FinFly Lite should be used.','2010-01-14',11,-1,2,1,0,'en',5,'2010-01-14 13:50:29','2010-01-14 13:50:29'),(44,'Q: How is the Solution being specified?','A: Gamma International needs to analyze the clients targeted IP Backbone Infrastructure in order to specify relevant capacity and interfaces of the HW.','2010-01-14',11,-1,3,1,0,'en',5,'2010-01-14 13:50:58','2010-01-14 13:50:58'),(45,'Q: How is the solution being installed within the network?','A: The provided hardware needs to be installed transparent into the IP Traffic whereas the location is mostly within the ISP or Backbone infrastructure provider. The solution is a standard 19’’ component with a remote Admin User Interface.','2010-01-14',11,-1,4,1,0,'en',5,'2010-01-14 13:51:34','2010-01-14 13:51:34'),(46,'Q: What happens in case of a HW failure?','A: In case the hardware fails, the system switches over to the Bypass switch and routes the traffic through outside the FinFly ISP environment to guarantee a 100% performance sides the ISP.','2010-01-14',11,-1,5,1,0,'en',5,'2010-01-14 13:51:59','2010-01-14 13:51:59'),(47,'Q: What Target Operating Systems are supported?','A: The following Operating Systems are supported: Windows XP, Vista and 7, Linux 2.6 (several Distributions). OSX support will be released in Q3 2011','2010-01-14',12,-1,1,1,0,'en',5,'2010-01-14 13:56:33','2011-05-25 13:30:27'),(48,'Q: Does the Target System need to have a FireWire Port?','A: The FireWire/1394 port is just one of the possibilities to attach the FinFireWire device. Additional to this also PCMCIA cards and Express Cards can be used.','2010-01-14',12,-1,2,1,0,'en',5,'2010-01-14 13:56:55','2010-01-14 13:56:55'),(49,'Q: What products can FinFly Web be combined with?','A: FinSpy, FinFly Lite and FinFly ISP.','2010-01-14',13,-1,1,1,0,'en',5,'2010-01-14 13:57:37','2010-01-14 13:57:37'),(50,'Q: Where are the trainings conducted?','A: Either in-country, Germany or UK.','2010-01-14',4,-1,1,1,0,'en',5,'2010-01-14 13:59:37','2010-01-14 13:59:37'),(51,'Q: What about trainings for the products?','A: Each product comes with a product training which takes between 1-5 days depending on the product.','2010-01-14',4,-1,2,1,0,'en',5,'2010-01-14 14:00:01','2010-01-14 14:00:01'),(52,'Q: Can custom trainings be given?','A: Yes, trainings on most IT Intrusion related topics can be given.','2010-01-14',4,-1,3,1,0,'en',5,'2010-01-14 14:00:22','2010-01-14 14:00:22'),(53,'Q: What knowledge do the students require?','A: The students should have a solid basic knowledge of:</br>\r\n<BLOCKQUOTE>\r\n• Windows / Linux (optional but helpful)</br>\r\n• Networking (TCP/IP)</br>\r\n• Programming (optional but helpful)</br>\r\n• IT Security basics</br>\r\n• Depending on the training course specific knowledge would be required. This will be discussed as per training course.</br>\r\n</BLOCKQUOTE>','2010-01-14',4,-1,4,1,0,'en',5,'2010-01-14 14:02:12','2010-01-14 14:02:12'),(54,'Q: How many students can part in the course?','A: Maximum of 4 to keep the trainings effective. Nevertheless the client can increase the number of trainees but then needs to accept the limitation on know how transfer.','2010-01-14',4,-1,5,1,0,'en',5,'2010-01-14 14:03:17','2010-01-14 14:03:17'),(55,'Q: How can the customer be 100% sure that Gamma cannot access to the FinSpy server/proxy once it is bought and installed at customer premises? ','A: The only connection the Gamma system is doing to the German head-quarters is when asking for updates. This can be disabled and updates can be delivered via Websites, Skype, CD-Rom, etc...','2010-11-12',1,-1,12,1,0,'en',5,'2010-11-12 18:36:41','2010-11-12 17:37:44'),(56,'Q: Since FinSpy will control and manage a number of targets (infected PC, laptop), how can customer be sure that these targets will not be also known by Gamma? ','A: Several options are possible<br><br>\r\n\r\na.) All communication of the server could be monitored e.g. using an external system that analyses all the network traffic. This would show any possible connections from the system to Gamma or the other way round. <br><br>\r\n\r\nb.) The customer has also the possibility to come to Munich office for 2-3 weeks and do a source-code review to ensure that no backdoors are inside the software. He could then compile it himself there and take the executables with him. Due to the fact that gamma publishes quarterly updates, this process is not really efficient as with every update it would need to happen again and the updates have to be installed to ensure continuous functionality and anti-virus bypassing.<br><br>\r\n\r\nc.) All encryption certificates that are used to encrypt all files, communications and also control access, are generated by the customer during the installation. Even when using the same software, Gamma would not be able to access the system because they do not have the correct RSA encryption keys.<br><br>\r\n\r\nd.) After the installation, the customer can change all IP addresses of server, proxies, etc. and therefore ensure that Gamma has no knowledge of the location, addresses, etc... <br><br>\r\n\r\ne.) Gamma is an independent company that is not bound to any country, governmental organisation, etc. Being able to spy on customer systems would not just destroy the company’s reputation but also bring it into serious legal problems.<br><br>','2010-11-12',1,-1,13,1,0,'en',5,'2010-11-12 18:43:09','2010-11-12 18:02:49'),(57,'Q: How can the customer be 100% sure that Gamma cannot access to the FinSpy server/proxy once it is bought and installed at customer premises?','A: The only connection the Gamma system is doing to the German head-quarters is when asking for updates. This can be disabled and updates can be delivered via Websites, Skype, CD-Rom, etc...','2011-05-25',1,-1,14,1,1,'en',5,'2011-05-25 15:44:31','2011-05-25 13:45:55');
